/* jshint esversion: 6 */
import React from 'react';
import GoogleMapReact from 'google-map-react';



export default function map(){
    let defaultProps;
    defaultProps = {
        center: {lat: 59.95, lng: 30.33},
        zoom: 11
    };
        return (
            <div>
            <GoogleMapReact defaultCenter={this.props.center} defaultZoom={this.props.zoom}/>
            </div>
        );
}
